import './App.css';
import Mycontext from './Context'
import Navbar from './layouts/Navbar'
import {useState,useEffect} from 'react'






const {deger} = useState("merhaba")


function App() {
  return (
    <Mycontext.provider value = {{deger}}>
      <div className="App">
      <Navbar/>



    </div>
    </Mycontext.provider>

  );
}

export default App;
